import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import HomePage from "./Component/Home";
import Navbar from "./Component/Mynavbar";
function App() {
  return (
    <BrowserRouter>
      <Router>
        <Routes>
          <Route path="/" element={<HomePage />} />
        </Routes>
      </Router>
    </BrowserRouter>
  );
}

export default App;
